  const { transactions } = useContext(GlobalContext);

  return (
    <div>
      {" "}
      <h3>History</h3>
      <ul id="list" className="list">
        {transactions.map((transaction) => {
          return (
            <li>
              {transaction.text}{" "}
              <span>
                {" "}
                {sign}
                {transaction.amount}
              </span>
              <button className="delete-btn">x</button>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default TransactionList;
